    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from January through April
    of 1952. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including upland game birds, predators, and fish-
    is also covered. Resource management is outlined; topics include grazing and timber
    removal. The public relations section of the report describes recreational uses,
    Refuge visitors, and Refuge participation. N-R forms are attached.",nt"owner_org":
